function gameOfThrones(s) {
	const sSet = new Set(Array.from(s));
	const isOdd = s.length % 2 === 1;

	let gotOddValue = false;
	const notPalin = Array.from(sSet).some((key) => {
		const allKeys = s.match(new RegExp(key, "g") || []);
		const lengthChar = allKeys ? allKeys.length : 0;
		const keyIsOdd = lengthChar % 2 === 1;
		if (isOdd && keyIsOdd && gotOddValue) {
			return true;
		}
		if (!isOdd && keyIsOdd) {
			return true;
		}
		if (isOdd && keyIsOdd && !gotOddValue) {
			gotOddValue = true;
		}
	});
	return notPalin ? "NO" : "YES";
}

//console.log(gameOfThrones("cdefghmnopqrstuvw"));
//console.log(gameOfThrones("aaabbbb"));

console.log(
	gameOfThrones(
		""
	)
);
